import { Component } from "react";
import React from "react";
import { Link } from "react-router-dom";
import { Redirect } from "react-router-dom";
import cadastroDeServicoRequest from "../request/cadastroDeServicoRequest";
import CardCatalogoEspecifico from "./Cards/CardCatalogoEspecifico";

class CatalogoEspecifico extends React.Component {
  constructor() {
    this.id = sessionStorage.getItem("IdCatalogo");
    //sessionStorage.setItem("IdCatalogo", "");
    this.servicos = JSON.parse(cadastroDeServicoRequest(this.state.id));
  }

  render() {
    return (
      <div style={{ overflowX: "hidden" }}>
        <nav className="navbar navbar-dark navbar-expand text-white bg-info">
          <Link to="login.html">
            <i
              className="fas fa-user-circle"
              style={{ fontSize: "36px", color: "black" }}
            />
          </Link>
          <ul className="navbar-nav navbar-collapse justify-content-end">
            <li className="nav-item">
              <Link className="nav-link text-dark" to="#">
                Cat√°logo
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-dark" to="Meus servi√ßos.html">
                Meus Servi√ßos
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-dark" to="#">
                Meus Contratos
              </Link>
            </li>
          </ul>
          <form className="form-inline col-sm-5">
            <input
              className="form-control w-75 mt-2 ml-4"
              type="search"
              placeholder="O que voc√™ est√° procurando?"
            />
            <button className="btn btn-secondary mt-2 " type="submit">
              Buscar
            </button>
          </form>
          <Link to="#menu-toggle" id="menu-toggle" className="navbar-brand">
            <span className="navbar-toggler-icon" />
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarsExample02"
            aria-controls="navbarsExample02"
            aria-expanded="false"
            aria-label="Toggle navigation"
            onclick="mostra()"
          >
            <span className="navbar-toggler-icon" />
          </button>
        </nav>
        <h4 className="text-secondary" align="center">
          Cat√°logo espec√≠fico
        </h4>
        <div className="row" align="center">
          {this.props.servicos.map((servico, i) => {
            console.log("Entered");
            return <CardCatalogoEspecifico key={i} servico={servico} />;
          })}
        </div>
      </div>
    );
  }
}

export default CatalogoEspecifico;
